import React from 'react';
import Employee from './Employee';
import FormDependent from './FormDependent';


const ControlDependent = ()=>{
    return (
<div>
<FormDependent />
<button class="mt-5 btn btn-primary" type="button" data-toggle="collapse" data-target="#collapseExample" aria-expanded="false" aria-controls="collapseExample">
    View Employees
</button>

<div class="collapse" id="collapseExample">
  <div class="card card-body">
    <Employee />
  </div>
</div>


</div>
    );
};

export default ControlDependent;
